ஜ═════════ஜ۩۞۩ஜ═════════ஜ  • Ты говоришь, что любишь дождь, но когда он идет, ты открываешь зонтик... Ты говоришь, что любишь ветер, но когда он дует, ты поднимаешь воротник... Ты говоришь, что любишь солнце, но когда оно палит, ты укрываешься в тень... Вот этого я и боюсь... Ведь ты говоришь, что любишь меня... © •  • Если ты рождён без крыльев, не мешай им расти... © •  • В любимом человеке нравятся даже недостатки, а в нелюбимом раздражают даже достоинства... © •  • Когда сбываются самые заветные мечты, следует ожидать, что рано или поздно судьба предъявит тебе счет... © •  • Люби не то, что совершенно, а делай совершенным то, что любишь... © •  • Когда ты любишь, стук твоего сердца слышат все вокруг... Когда ненавидишь - он отдается лишь в твоей голове... Когда умираешь - только ты перестаешь его слышать, но он остается с теми, кто тебя любит… © •  • Ты любишь всех, а любить всех - значит не любить никого... Тебе все одинаково безразличны... © •  • Возможно, Бог хочет, чтобы мы встречали не тех людей до того, как встретим того единственного человека... Чтобы, когда это случится, мы были благодарны... © •  • Любовь бежит от тех, кто гонится за нею, а тем, кто прочь бежит, кидается на шею... © •  • Одиночество - это состояние, о котором некому рассказать... © •  • Любовь как наркотик... Один раз подумал о человеке - захотелось ещё... Подумал - началось привыкание... Опять подумал - зависимость... © •  • Она не любит тебя... P.S.: Закон жизни... Ты делаешь вид, что тебе пофиг... P.S.: Закон выживания... Ты наконец-то забил... P.S.: Закон алкоголя... © •  • Не трать время на человека, который не стремиться провести его с тобой... © •  • Люди не хотят жить вечно, люди просто не хотят умирать... © •  • Я безразлично отношусь к ножевым ударам врага, но мне мучителен булавочный укол друга... © •  • Любовь позволяет забыть время... Время позволяет забыть любовь... © •  • Умереть за любовь не сложно... Сложно найти такую любовь, за которую стоит умереть... © •  • Причинить самую страшную боль человеку сможет лишь тот, кто подарил ему больше всего счастья... © •  • Жизнь - это то, что происходит, когда ты строишь совсем другие планы... © •  • Это самое страшное - знать, что может быть лучше, чем есть… © •  • Там, где нельзя больше любить, там нужно пройти мимо... © •  • Понять проблемы других людей всегда проще, чем свои собственные... © •  • Если ты любишь что-то - отпусти... Если оно твое - оно вернется... © •  • Признаваться в своих недостатках, когда нас упрекают в них, - это скромность, открывать их своим друзьям - простодушие, доверчивость, выставлять же их перед всеми - гордость... © •  • Неопытная любовь говорит: "Я люблю тебя, потому что ты мне нужна"... Опытная: "Ты мне нужна, потому что я люблю тебя"... © •  • Просто друг хочет, чтобы ты был вместе с ним... Настоящий друг хочет быть вместе с тобой... © •  • Есть два пути избавить тебя от страдания: быстрая смерть и продолжительная любовь... © •  • Жизнь измеряется не количеством сделанных вдохов и выдохов, а количеством тех моментов, когда от счастья захватывает дух... © •  • Жизнь - как коробка шоколадных конфет... Никогда не знаешь, что внутри... © •  • Любовь как бабочка: сожмешь слишком сильно - раздавишь, отпустишь - и она улетит... © •  • Пары, которые предназначены друг другу, проходят через все преграды, что и остальные... Разница лишь в том, что они не сдаются и эти люди сражаются за свои отношения... © •  • Не бойся боли - ее слишком много в этом мире... Просто привыкни к ней... © •  • Когда влюбляешься безответно, хочется просить 
прощения у всех тех, кто был безответно влюблен в тебя... © •


